// 鼠标左键是否按下
var isMouseDown;

// 鼠标按下x值
var mouseDownStartX;

// 鼠标移动距离
var mouseMoveX;
var mouseMoveLength;

// 大图
var imageBase64;

// 小图
var _smallImage;

// 小图相对大图的Y轴坐标
var _y;

// 记录令牌
var _id;

// dom在浏览器的位置
function getElementPosition(element)
{
    let top = element.offsetTop
    let left = element.offsetLeft
    let width = element.offsetWidth
    let height = element.offsetHeight
    var currentParent = element.offsetParent;
    while (currentParent !== null)
    {
        top += currentParent.offsetTop
        left += currentParent.offsetLeft
        currentParent = currentParent.offsetParent
    }

    return { top, left, width, height }
}

// 设置当前图片
function setCurrentImageBase64(imageBase64, smallImage, y)
{
    imageBase64 = imageBase64
    _smallImage = smallImage
    _y = y;
    document.getElementById('backImage').src = imageBase64
    document.getElementById('smallImage').src = _smallImage
    document.getElementById('smallImage').style.top = _y + 'px';
}

function check(x) {
    $.get("Check?code=" + x + "&id=" + _id, function (data) {
        var obj = JSON.parse(data);
        if (obj.code == "0") {
            alert("验证成功");
        }
        else {
            alert("验证失败");
        }
    });
}

window.onload = function ()
{
    $.get("Create", function (data) {
        // 获取两张图片和令牌
        var obj = JSON.parse(data);
        _id = obj.data.id;
        // new SlidingVerification('data:image/webp;base64,')
        setCurrentImageBase64(
            'data:image/webp;base64,' + obj.data.bigImg,
            'data:image/webp;base64,' + obj.data.smallImg,
            obj.data.y);
    });

    document.onmousedown = function (event)
    {
        var obj = getElementPosition(document.getElementById('sliderBlock'))
        if (event.clientX > obj.left &&
            event.clientX < (obj.left + obj.width) &&
            event.clientY > obj.top &&
            event.clientY < (obj.top + obj.height))
        {
            // 鼠标点击事件发生在滑动条的范围内
            this.isMouseDown = true
            this.mouseDownStartX = event.clientX
            console.log("鼠标点击事件发生在滑动条的范围内");
        }
    }

    document.onmousemove = function (event)
    {
        if (this.isMouseDown)
        {
            this.mouseMoveLength = event.clientX - this.mouseDownStartX;    // 计算滑块拖动的距离
            if (this.mouseMoveLength + 5 > 0 &&
                this.mouseMoveLength + 5 < document.getElementById('backImage').offsetWidth - 5 - document.getElementById('smallImage').offsetWidth) {
                // 滑块拖动的最小距离是5px，最大距离是大图的宽度 - 小图的宽度
                document.getElementById('smallImage').style.left = 5 + this.mouseMoveLength + 'px'
                document.getElementById('sliderBlock').style.left = 5 + this.mouseMoveLength + 'px'
            }
        }
    }

    document.onmouseup = function (event)
    {
        // 鼠标松开后停止拖动
        if (this.isMouseDown)
        {
            this.isMouseDown = false
            var x = document.getElementById('smallImage').style.left;
            // console.log("小图移动了：" + x);
            check(x.replace("px", ""));
        }
    }
}

